import React from 'react';
import { Button } from 'reactstrap';
import { useMainBox } from '../contexts/MainBoxContext';
import ScreenType from '../enuns/ScreenType';

const Cadastros : React.FC = () => {
    const { setScreen } = useMainBox();
    return(
        <div style={{display: 'flex', alignItems: 'center', justifyContent: 'center', height: "100%", width: "100%"}}>
            <div style={{justifySelf: 'space-evenly'}}>
                <Button type="button" color="primary" onClick={() => setScreen(ScreenType.CADASTROSFISICA)}>
                    Sou pessoa física        
                </Button>
                <Button type="button" color="primary" onClick={() => setScreen(ScreenType.CADASTROSJURIDICA)}>
                    Sou pessoa jurídica
                </Button>
                <Button type="button" color="primary" onClick={() => setScreen(ScreenType.CADASTROSFORNECEDOR)}>
                    Sou fornecedor
                </Button>
            </div>
        </div>
    )
}

export default Cadastros;
